import { useNavigate, useNavigation } from "react-router-dom";
import * as S from "./index.styles";
const HomeScreen = () => {
  const { navigate } = useNavigate();

  const handleGoSecondScreen = () => {
    navigation();
  };

  return (
    <div>
      <S.ButtonContainer>
        <S.Button>Dark Theme</S.Button>
        <S.Button>Light Theme</S.Button>
      </S.ButtonContainer>
      <S.Button onClick={handleGoSecondScreen}></S.Button>
    </div>
  );
};

export default HomeScreen;
